import styled from 'styled-components';

export const Container = styled.div`
  height: 30px;
  background-color: teal;
  color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 14px;
  font-weight: 500;
`;

export const Wrapper = styled.div`
  text-align: center;
`;
